import React, { useEffect, useState } from 'react';

const LiveTrading = () => {
  const [data, setData] = useState<any>(null);

  useEffect(() => {
    fetch('http://192.168.1.107:8000/api/live')
      .then(res => res.json())
      .then(setData);
  }, []);

  return (
    <section>
      <h2>Live Trading</h2>
      <pre>{JSON.stringify(data, null, 2)}</pre>
    </section>
  );
};

export default LiveTrading;
